import { Link } from "react-router-dom";

export default function Header() {

  return (
    <>
    <div className="header">
     <h1>Welcome in <b><Link to="/">OffLimits Library</Link></b> official website !<span className="linkBorder"></span></h1>
    </div>
    </>

  )
}
